#include <math.h>
#include <stdio.h>

bool test_model_numeric(float* logits, float eps = 0.001f)
{
    const size_t num_elements = sizeof(true_logits) / sizeof(*true_logits);
    size_t errors_number = 0;
    float std_dev = 0.0f;
    for (size_t i = 0; i < num_elements; i++) {
        float diff = fabs(logits[i] - true_logits[i]);
        if (diff > eps)
            errors_number++;
        std_dev += diff * diff;
    }
    std_dev = sqrtf(std_dev);

    printf("\nValidating logits: %d elements\n", num_elements);
    printf("Number of errors: %d\n", errors_number);
    printf("stddev: %f\n", std_dev);

    return errors_number == 0;
}

